var $bm_rt;
var flashWidth, timeToMarker;
try {
    flashWidth = $bm_div(effect('Opacity Flash - layer markers')('Flash Width (msec)'), 2000);
    timeToMarker = Math.abs($bm_sub(time, marker.nearestKey(time).time));
    $bm_rt = easeOut(timeToMarker, flashWidth, 0, 100, 0);
} catch (err1) {
    $bm_rt = 100;
}
